import './App.css';
import { Canvas } from '@react-three/fiber';


function App() {
  return (
    <div id='canvas-container'>
      <Canvas>
        <mesh>
          <boxGeometry args={[2, 2, 2]} />
          <ambientLight intensity={0.5} />
          <spotLight position={[10, 10, 10]} angle={9.15} penumbra={1} />
        </mesh>
      </Canvas>
    </div>
  )
}

export default App;
